#gets them in right order to pop
@kmers = reverse(@kmers);
#string to output
my $outputS = "";
#goes through each kmer
while(@kmers) {
	#pops off
	my $currentVar = pop @kmers;
	#establishes pattern
	if($outputS eq "") {
		$outputS = $currentVar;
	}
	#continues pattern
	else {
		$outputS = $outputS . substr($currentVar, -1);
	}
}
#outputs result
print $outputS,"\n\n";